import React from "react";
import { Form, Button } from "react-bootstrap";


function DrPoll(props) {
    function clickcc() {
        console.log("clicklick")
    }
    const hello = () => {
        <h1>Hello</h1>
    }

    return (
        <div>
            <div className="dr-poll">
                <form className="dr-form">
                    <button className="custom-btn first-btn" type="button" value={props.drivers[0]}>{props.drivers[0]}</button>
                    {(props.drivers).slice(1, props.drivers.length - 1).map((name) => (
                        <button className="custom-btn" type="button" value={name}>{name}</button>
                    ))}
                    <button className="custom-btn last-btn" type="button" value={props.drivers[props.drivers.length - 1]}>{props.drivers[props.drivers.length - 1]}</button>
                </form>
                <label><Button varient="primary">Hi</Button></label>
            </div>
            <div className="dr-results">
                <h1>World {props.num2}</h1>
            </div>
        </div>
    )
}

export default DrPoll;
